import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import 'swiper/css/navigation';
import '../../styles.css';
import { Grid, Navigation } from 'swiper/modules';
import { Pagination } from 'swiper/modules';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBoxesStacked, faPeopleGroup, faStore, faTruck } from '@fortawesome/free-solid-svg-icons';



function Slider(){
    return(
        <div className='bg-emerald-900'>
        <Swiper navigation={true} loop={true} slidesPerView={4} grid={{
          rows: 1,
        }} spaceBetween={30} pagination={{
          clickable: true,
        }} modules={[Grid, Pagination, Navigation]} className="mySwiper h-28">
            {/* Slide 1 */}
            <SwiperSlide className='bg-emerald-600'>
                <div className='flex flex-col gap-0.5'>
                    <FontAwesomeIcon icon={faStore} className='h-20' />
                    <label className='text-white font-bold'>
                        Cadastro de Fornecedores
                    </label>
                </div>
            </SwiperSlide>
            {/* Slide 2 */}
            <SwiperSlide className='bg-emerald-700'>
                <div className='flex flex-col gap-0.5'>
                    <FontAwesomeIcon icon={faTruck} className='h-20' />
                    <label className='text-white font-bold'>
                        Cadastro de Vendedores
                    </label>
                </div>
            </SwiperSlide>
            {/* Slide 3 */}
            <SwiperSlide className='bg-emerald-700'>
                <div className='flex flex-col gap-0.5'>
                    <FontAwesomeIcon icon={faPeopleGroup} className='h-20' />
                    <label className='text-white font-bold'>
                        Cadastro de Vendedores
                    </label>
                </div>
            </SwiperSlide>
            {/* Slide 4 */}
            <SwiperSlide className='bg-emerald-700'>
                <div className='flex flex-col gap-0.5'>
                    <FontAwesomeIcon icon={faBoxesStacked} className='h-20' />
                    <label className='text-white font-bold'>
                        Cadastro de Vendas
                    </label>
                </div>
            </SwiperSlide>
            <SwiperSlide>Slide 5</SwiperSlide>
            <SwiperSlide>Slide 6</SwiperSlide>
            <SwiperSlide>Slide 7</SwiperSlide>
            <SwiperSlide>Slide 8</SwiperSlide>
            <SwiperSlide>Slide 9</SwiperSlide>
        </Swiper>
    </div>
    )
}

export default Slider;
